import React from "react";
import axios from "axios";
import { API_URL } from "../config";
import LoadingSpinner from "./LoadingSpinner";

const MatchStatsPopup = ({ match, onClose, isOpen }) => {
  const [loading, setLoading] = React.useState(true);
  const [batsmenStats, setBatsmenStats] = React.useState([]);
  const [error, setError] = React.useState(null);

  React.useEffect(() => {
    const fetchBatsmenStats = async () => {
      try {
        setLoading(true);
        console.log("Fetching stats for match:", match);
        const response = await axios.get(`${API_URL}/match-stats`, {
          params: {
            matchId: match._id,
            team: match.winner,
          },
        });
        console.log("Batsmen Stats Response:", response.data);
        setBatsmenStats(response.data);
      } catch (err) {
        console.error("Error fetching batsmen stats:", err);
        console.error("Match details:", match);
        setError("Failed to load batsmen statistics");
      } finally {
        setLoading(false);
      }
    };

    if (isOpen && match) {
      fetchBatsmenStats();
    }
  }, [isOpen, match]);

  if (!isOpen) return null;

  return (
    <div
      className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50"
      onClick={(e) => {
        if (e.target === e.currentTarget) {
          onClose();
        }
      }}
    >
      <div className="bg-white rounded-lg p-6 max-w-2xl w-full mx-4">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-xl font-bold text-gray-800">
            {match.winner} - Top Performers
          </h2>
          <button
            onClick={onClose}
            className="text-gray-500 hover:text-gray-700"
          >
            <svg
              className="w-6 h-6"
              fill="none"
              stroke="currentColor"
              viewBox="0 0 24 24"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M6 18L18 6M6 6l12 12"
              />
            </svg>
          </button>
        </div>

        {loading ? (
          <LoadingSpinner />
        ) : error ? (
          <div className="text-red-500 text-center">{error}</div>
        ) : (
          <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    Batsman
                  </th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    Runs
                  </th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    Balls
                  </th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    4s
                  </th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    6s
                  </th>
                  <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase">
                    SR
                  </th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {batsmenStats.map((batsman) => (
                  <tr key={batsman.batsman} className="hover:bg-gray-50">
                    <td className="px-4 py-2 whitespace-nowrap text-sm font-medium">
                      {batsman.batsman}
                    </td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm">
                      {batsman.runs}
                    </td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm">
                      {batsman.balls}
                    </td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm">
                      {batsman.fours}
                    </td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm">
                      {batsman.sixes}
                    </td>
                    <td className="px-4 py-2 whitespace-nowrap text-sm">
                      {batsman.strikeRate.toFixed(2)}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default MatchStatsPopup;
